r($,"apY","aeA",()=>A.a([A.i8("Terletak sekitar 20 km sebelah barat dari Ibukota Kabupaten Kebumen.Puluhan pintu dan jendela menjadi fitur menarik bangunan yang kemudian diubah menjadi benteng yang menjadi salah satu destinasi wisata di Kebumen yang cukup ikonik. ","https://correcto.id/content/images/th1_2021032802102696295_tiny.jpg",B.at,"Benteng Van den Wijck"),A.i8("Pantai Menganti Kebumen merupakan destinasi wisata eksotis seperti di Selandia Baru.Saat berkunjung ke Pantai Menganti selain menikmati pemandangan indahnya air pantai yang jeernih,ombak kecil,pasir putih bak mutiara,dan batu karang yang indah,terdapat juga beberapa objek wisata yang ditawarkan yaitu lembah mengunengdan,bermain sepeda gantung","https://www.pesisir.net/wp-content/uploads/2020/12/Pantai-Menganti-Kebumen.jpg",B.at,"Pantai Menganti"),A.i8("Bukit ini merupakan bagian dari Cagar Alam Nasional Geologi Karangsambung.Dari total luas lahan 20 hektar, lima hektar di antaranya dapat kamu jelajahi untuk mencari titik terbaik menunggu matahari terbit. Untuk itu, berkemah bersama teman-teman di sini bisa kamu jadikan aktivitas akhir pekanmu.","https://ticmpu.id/wp-content/uploads/job-manager-uploads/company_logo/2021/03/tulu1-825x510.jpg",B.at,"Bukit Pentulu Indah"),A.i8("Gua Petruk merupakan gua yang paling dijaga kealamiannya. Bahkan pengelola memutuskan untuk tidak memasang penerangan di dalamnya. Maka dari itu, untuk menikmati stalaktit dan stalagmit yang didominasi dengan bentuk seperti hidung wayang Petruk ini, pengunjung dapat menggunakan headlamp dan helm khusus yang disediakan oleh petugas. Selain itu, ada baiknya kamu mengenakan baju tahan air karena di dalam gua, banyak genangan air yang harus kamu lewati. Menantang adrenalin, dan pasti mengasyikkan!","https://picture.triptrus.com/image/2014/06/gua-petruk-2.jpeg",B.at,"Gua Petruk"),A.i8("Destinasi wisata di Kebumen ini diresmikan ulang sebagai taman wisata dengan fasilitas-fasilitas yang lebih modern, termasuk wahana permainan sepeda layang, flying fox, dan panahan. Terdapat pula gazebo untuk kumpul keluarga. Tentu saja, yang paling menarik dari BAP adalah cuacanya yang lumayan sejuk.","https://1.bp.blogspot.com/-wu3fG03Pb78/XHFcbdX6zWI/AAAAAAAABY4/sD5-1XLJOjUtiRbL3s12W1fwvNnbIWA8wCLcBGAs/s1600/IMG_20190109_093902.jpg",B.at,"Brujul Adventure Park"),A.i8("Di Kebumen ada tempat yang menawarkan kesejukan, serta pemandangan matahari terbit yang indah, yaitu Waduk Sempor.Lokasinya terletak di perbukitan dengan ribuan pohon pinus. Waduk ini merupakan bendungan yang menghubungkan Sungai Jatinegara atau Sungai Sempor, Sungai Cicingguling, dan Samudra Hindia.Keberadaannya sangat penting untuk mengairi ribuan sawah di wilayah Kabupaten Kebumen bagian barat. Selanjutnya, Waduk Sempor mungkin akan menempati posisi penting untuk feeds Instagram-mu.","https://www.goodnewsfromindonesia.id/uploads/post/large-goodnewsfromindonesia-gnfi-waduk-sempor-9d1ad02199350c16593e66684c41ed0b.jpg",B.at,"Waduk Sempor"),A.i8("Bukit Hood, Hud, atau Uhud adalah bukit yang berada di ketinggian 150 mdpl (meter di atas permukaan laut). Dari ketinggian, kamu bisa menikmati pemandangan yang mengesankan akan pesisir selatan Pulau Jawa.Ada juga spot menarik yang dibuat warga lokal, yaitu anjungan untuk para pengunjung agar bisa melihat garis pantai dengan lebih jelas. Tentu saja, view yang menawan ini tidak disia-siakan oleh para penggemar fotografi. Lokasinya cukup mudah dijangkau kok, yaitu dekat dengan Pantai Karangbolong.","https://cdn0-production-images-kly.akamaized.net/r_DnBizhw2NlXmYvUlLIGuWXRig=/640x360/smart/filters:quality(75):strip_icc():format(jpeg)/kly-media-production/medias/2920920/original/002241400_1569334501-BUKIT_HUD_3-Ridlo.jpg",B.at,"Bukit Hud"),A.i8("Pantai Surumanis Kebumen adalah pantai dengan pasir pantai berwarna hitam kecoklatan dengan batu karang besar disekelilingnyaPantai ini memiliki pemandangan yang eksotik dengan batu karang yang indah mengelilinginya. Fasilitas demi fasilitas juga sudah dikembangkan di Pantai ini. Beberapa spot foto sudah disediakan oleh pihak pengelola kepada pengunjung.Pemandangan di pantai ini dapat memanjakan mata pengunjung. Terdapat batu karang yang mengelilingi pasir berwarna hitam kecoklatan tersebut serta terdapat spot untuk melihat pemandangan dari berbagai sudut pandang..","https://postpangandaran.com/photo/plugin/article/2021/1623306388_1-org.JPG",B.at,"Pantai Surumanis"),A.i8("Kampoeng Etnik menjadi destinasi baru di Kabumen Jawa Tengah dengan konsep wisata keluarga yang ramah anak. Karena tempat piknik satu ini menyuguhkan berbagai macam spot menarik dengan wahana permainan seru didalamnya. Aroma klasik khas Jawa juga menjadi daya tarik tersendiri mulai dari ornamen bangunan dan lainnya.Manjakan akhir pekan bersama keluarga di Kabumen dengan explore pesona wisata Kampung Etnik. Dijamin liburan anda akan menyenangkan dengan menikmati berbagai macam spot terbaik dari wisata Jawa Tengah satu ini. Rasa bosan dan jenuh akan sibuknya aktivitas sehari-hari bisa anda refresh bersama keluarga tercinta di tempat ini.","https://origin.pegipegi.com/jalan/images/pict1L/Y8/Y950318/Y950318023.jpg",B.at,"Kampung Etnik"),A.i8("Goa Jatijajar juga sering disebut sebagai tempat berpetualang di perut bumi. Hal ini tak lepas dari jarak gua yang memiliki panjang 250 meter. Goa ini memiliki tinggi rata-rata 12 meter dengan lebar 15 meter.di dalam gua terdapat hal lain yang tak kalah menarik. Hal tersebut adalah stalagtit dan stalagmit yang menghiasi sepanjang goa. Stalagtit dan stalagmit merupakan batuan alami yang terbentuk di dalam goa.Batuan tersebut terbentuk dari endapan air hujan yang bereaksi dengan batu kapur. Bentuk stalagmit berasal dari bawah, menuju ke atas. Sedangkan stalagtit menggantung dari atas goa menuju ke bawah.","https://www.pegipegi.com/travel/wp-content/uploads/2017/10/Jatijajar.jpg",B.at,"Goa Jatijajar")],A.a6("u<zT>")))
